  state = {
    data :[]
  }
  async  componentDidMount(){
    const response = await fetchData();
    this.setState({data : response.data.result });

  }

  render(){
    return (
      <div className="App">

        <PieChart1 res= {this.state.data}/>
      </div>
    );

  }

}

export default App;
